        private drawSingleCanvas(index: number) {
            let canvas: any = document.getElementById('myCanvas' + index);
            if (canvas && canvas.getContext) {
//                添加id模块监听
                let ctx = canvas.getContext('2d');
                let length = this.data.length || 0;
//                初始化线条颜色
                ctx.lineWidth = 1;
                ctx.strokeStyle = 'rgba(0,0,0,1)';
//                绘制canvas线条
                ctx.beginPath();
                ctx.moveTo(0, (this.data[this.baseNum + index] + 1) * 100);
//                循环绘制多个canvas波段
                for (let i = 1; i < length; i++) {
                    let position = (i - this.baseNum * index) / this.baseNum * this.boxWidth;
                    ctx.lineTo(position, (this.data[i] + 1) * 100);
                    if (String(i / 500).indexOf('.') === -1) {
                        ctx.fillText('16:30', position - 13, 190);
                    }
                }
                ctx.stroke();
//                绘制完成
            }
        }

        //            绘制canvas
        private drawCanvas() {
            for (let i = 0; i < 5; i++) {
                this.drawSingleCanvas(i);
            }
        }

//        初始化方法
//        变为红色线
        private changeRed() {
            let parent = $('.tagPointer[data-index=' + this.curIndex + ']');
            parent.css({
                backgroundColor: this.baseColor
            });
        }

//        变为黑色线
        private changeBlack() {
            let obj = $('.tagPointer[data-index=' + this.curIndex + ']');
            obj.css({
                backgroundColor: this.selectColor
            });
        }

        private initState() {
            this.changeRed();
            this.rythemTxt = '';
            this.selectState = false;
            this.addLineState = false;
            this.setRythmStartState = false;
            this.setRythmEndState = false;
        }

//        添加div
        private appendDiv(item: any, index: any) {
            let obj = $('.bg_box').eq(index);
            let leftPosition = (item.position - index * this.baseNum) / this.baseNum * this.boxWidth;
            let style = `position:absolute;left:${leftPosition}px;height:90%;top:0;width:1px;background-color:${this.baseColor};`;
            let addDiv = `<div style=${style} data-index=${this.tagIndex} class="tagPointer">
                            <i style="width: 20px;height:20px;background-image: url(${this.imgSrc});background-repeat:no-repeat;background-size:100%;position: absolute;top: -15px;left:-10px;cursor:pointer;" class="pointer"></i>
                            <div class="shadow" style="position:absolute;left:0;width:0;height: 100%;background-color: rgba(0,0,0,.1)">
                                <p></p>
                            </div>
                            <p style="position: absolute;width: 20px;text-align: center;top:16px;background:#fff;left: -10px;font-size: 16px;word-break: break-all;color: ${this.labelColor};line-height:12px;font-weight:600"></p>
                           </div>`;
            obj.append(addDiv);

//            $('.shadow').on('mousemove', (e: any) => {
//                let outerX = $('.outer_box').offset().left;
//                let x = e.clientX - outerX - 20.5;
//                let index = $(e.target).parent().parent().index();
//                let suddenlyIndex = this.tagIndex + 1;
//                this.curIndex = this.tagIndex;
//                if (this.overLineState === false && x > 1) {
//                    $('.tagPointer[data-index=' + this.curIndex + ']').css({left: x});
//                }
//            });
            if (!this.addLineState) {
                this.tagIndex++;
            }
        }

//        移除标注线
        private removeLineFunc() {
            if (this.selectState) {
                let dataIndex = this.mapSearch(parseInt(String(this.curIndex)));
                let bindIndex = this.tagData[dataIndex].bindIndex;
                let bindTagDataIndex = this.mapSearch(bindIndex);

                $('.tagPointer[data-index=' + this.curIndex + ']').remove();
                if (bindIndex != -1) {
                    let bindBlock = Math.floor(this.tagData[bindTagDataIndex].position / this.baseNum);
                    let curBlock = Math.floor(this.tagData[dataIndex].position / this.baseNum);

                    let starttIndex = curBlock;
                    let enddIndex = bindBlock;

                    if (starttIndex > enddIndex) {
                        starttIndex = bindBlock;
                        enddIndex = curBlock;
                    }
                    this.tagData[bindTagDataIndex].bindIndex = -1;
                    $('.tagPointer[data-index=' + bindIndex + ']').children('.shadow').css({width: 0});
                    for (let i = starttIndex + 1; i < enddIndex; i++) {
                        $('.bg_box').eq(i).children('.bg_shadow').css({
                            width: 0
                        });
                    }
                }
                this.initState();
                this.tagData.splice(dataIndex, 1);
            } else {
                this.$message.error('请先选择标注线！')
            }
        }

        private clickBind(suddenlyIndex) {
            $('.tagPointer').bind('click', (e: any) => {
                this.initState();
                let index = $(e.target).parent().index();
                let x = parseInt($(e.target).css('left'));
                $('.tagPointer[data-index=' + suddenlyIndex + ']').css({left: x});
                this.tagData.push({
                    position: this.baseNum * index + (x / this.boxWidth) * this.baseNum,
                    bindIndex: -1,
                    nowIndex: this.tagIndex
                });
                this.tagIndex++;
                $('.tagPointer').unbind();
                $('.bg_box').unbind();
                $('.shadow').unbind();
                this.addClickFunc();
            });
        }
//        添加标注线
        private addLineFunc() {
            this.selectState = false;
            this.addLineState = true;
            this.changeRed();
            $('.tagPointer').bind('mouseover', (e: any) => {
                return false;
            });
            $('.tagPointer').bind('mouseleave', (e: any) => {
                return false;
            });
            $('.shadow').bind('mouseenter', (e: any) => {
                if (this.addLineState) {
                    let outerX = $('.outer_box').offset().left;
                    let x = e.clientX - outerX - 20.5;
                    let index = $(e.target).parent().parent().index();
                    let suddenlyIndex = this.tagIndex + 1;
                    this.curIndex = this.tagIndex;
                    this.appendDiv({position: x}, index);
                    this.clickBind(suddenlyIndex);
                }
            });
            $('.bg_box').bind('mouseenter', (e: any) => {
                if (this.addLineState) {
                    let outerX = $('.outer_box').offset().left;
                    let x = e.clientX - outerX - 20.5;
                    let index = $(e.target)[0].id.split('myCanvas')[1];
                    let suddenlyIndex = this.tagIndex + 1;
                    this.curIndex = this.tagIndex;
                    this.appendDiv({position: x}, index);
                    this.clickBind(suddenlyIndex);
                }
            });
            $('.bg_box').bind('mouseleave', () => {
                if (this.addLineState) {
                    $('.tagPointer[data-index=' + this.curIndex + ']').remove();
                } else {
                    $('.bg_box').unbind();
                }
            });
            $('.bg_box').bind('mousemove', (e: any) => {
                let outerX = $('.outer_box').offset().left;
                let x = e.clientX - outerX - 20.5;
                if (this.overLineState === false && x > 1) {
                    $('.tagPointer[data-index=' + this.curIndex + ']').css({left: x});
                }
            });
        }

//        绘制tags
        private drawTags() {
            this.tagData.map(item => {
                if (item.position < this.baseNum) {
                    this.appendDiv(item, 0);
                } else if (item.position < this.baseNum * 2) {
                    this.appendDiv(item, 1);
                } else {
                    this.appendDiv(item, 2);
                }
            });
        }

//        移动刻度线
        private transTagPointer(obj: any, leftNum: number, keyCode: number) {
            if (leftNum >= 0 && leftNum <= this.boxWidth) {
                let dataIndex = this.mapSearch(parseInt(String(this.curIndex)));
                let blockIndex = Math.floor(this.tagData[dataIndex].position / this.baseNum);
                let bindIndex = this.tagData[dataIndex].bindIndex;
                let bindTagDataIndex = this.mapSearch(bindIndex);
                let width = parseInt(obj.children('.shadow').css('width'));

                if (blockIndex === 0) {
                    if (leftNum <= 1) {
                        leftNum = 1;
                    }
                    if (leftNum >= this.boxWidth - 1) {
                        let obj = $('.tagPointer[data-index=' + this.curIndex + ']');
                        blockIndex++;
                        $('.bg_box').eq(blockIndex).append(obj);
                        leftNum = 1;
                        this.tagData[dataIndex].position = Math.floor(1 / this.boxWidth * this.baseNum + this.baseNum * blockIndex);
                    }
                } else if (blockIndex < 5) {
                    if (leftNum <= 1) {
                        let obj = $('.tagPointer[data-index=' + this.curIndex + ']');
                        blockIndex--;
                        $('.bg_box').eq(blockIndex).append(obj);
                        leftNum = this.boxWidth - 1;
                        this.tagData[dataIndex].position = Math.floor((leftNum - 1) / this.boxWidth * this.baseNum + this.baseNum * blockIndex);
                    } else if (leftNum >= this.boxWidth - 1) {
                        let obj = $('.tagPointer[data-index=' + this.curIndex + ']');
                        blockIndex++;
                        $('.bg_box').eq(blockIndex).append(obj);
                        leftNum = 1;
                        this.tagData[dataIndex].position = Math.floor(1 / this.boxWidth * this.baseNum + this.baseNum * blockIndex);
                    }
                } else {
                    if (leftNum >= this.boxWidth - 1) {
                        leftNum = this.boxWidth - 1;
                    }
                    if (leftNum <= 1) {
                        let obj = $('.tagPointer[data-index=' + this.curIndex + ']');
                        blockIndex--;
                        $('.bg_box').eq(blockIndex).append(obj);
                        leftNum = this.boxWidth - 1;
                        this.tagData[dataIndex].position = Math.floor((leftNum - 1) / this.boxWidth * this.baseNum + this.baseNum * blockIndex);
                    }

                }

                if (keyCode === 39) {
                    obj.css({
                        left: leftNum + 1 + 'px'
                    });
                    if (bindIndex != -1) {
                        this.drawRythem(dataIndex, bindTagDataIndex);
                    }
                    this.tagData[dataIndex].position = Math.floor((leftNum + 1) / this.boxWidth * this.baseNum + this.baseNum * blockIndex);
                } else if (keyCode === 37) {
                    obj.css({
                        left: leftNum - 1 + 'px'
                    });
                    if (bindIndex != -1) {
                        this.drawRythem(dataIndex, bindTagDataIndex);
                    }
                    this.tagData[dataIndex].position = Math.floor((leftNum - 1) / this.boxWidth * this.baseNum + this.baseNum * blockIndex);
                }
            }
        }

//        遍历数组
        private mapSearch(index: number) {
            let returnData = -1;
            this.tagData.map((item, ind) => {
                if (item.nowIndex === index) {
                    returnData = ind;
                }
            });
            return returnData;
        };

//        画节律
        private drawRythem(startIndex: number, endIndex: number) {
            let startPointer = this.tagData[startIndex].position;
            let endPointer = this.tagData[endIndex].position;
            let startBlockIndex = Math.floor(startPointer / this.baseNum);
            let endBlockIndex = Math.floor(endPointer / this.baseNum);
//            判断是否反向
            if (startPointer > endPointer) {
                let temp = endIndex;
                endIndex = startIndex;
                startIndex = temp;
            }

            let nowIndexStart = this.tagData[startIndex].nowIndex;
            let nowIndexEnd = this.tagData[endIndex].nowIndex;
            this.tagData[startIndex].bindIndex = nowIndexEnd;
            this.tagData[endIndex].bindIndex = nowIndexStart;

            let startObj = $('.tagPointer[data-index=' + nowIndexStart + ']');//获取开始节点
            let endObj = $('.tagPointer[data-index=' + nowIndexEnd + ']'); //获取结束节点

            startObj.children('.shadow').css({
                width: 0 + 'px',
                left: 0
            });
            endObj.children('.shadow').css({
                width: 0 + 'px',
                left: 0
            });
            $('.bg_box').children('.bg_shadow').css({
                width: 0
            });
            this.crossBlock.map((item, index) => {
                if (item === startBlockIndex || item === endBlockIndex) {
                    this.crossBlock.splice(index, 1);
                } else {
                    $('.bg_box').eq(item).children('.bg_shadow').css({
                        width: '100%'
                    });
                }
            });

            let starttIndex: number = startBlockIndex;
            let enddIndex: number = endBlockIndex;

            if (startBlockIndex > endBlockIndex) {
                starttIndex = endBlockIndex;
                enddIndex = startBlockIndex;
            }

            if (enddIndex - starttIndex > 1) {
                let newBlockIndex: Array<number> = [];
                for (let i = starttIndex + 1; i < enddIndex; i++) {
                    newBlockIndex.push(i);
                    $('.bg_box').eq(i).children('.bg_shadow').css({
                        width: '100%'
                    });
                }
                if (this.crossBlock.length === 0) {
                    this.crossBlock = newBlockIndex;
                } else {
                    this.crossBlock = Array.from(new Set(this.crossBlock.concat(newBlockIndex)));
                }
            }

            let endShadowLeft = parseInt(endObj.css('left')); //获取结束节点到左边的距离
            if (startBlockIndex !== endBlockIndex) {
                let startShadowRight = parseInt(startObj.css('right')); //获取开始接到到右边的距离
                startObj.children('.shadow').css({
                    width: startShadowRight + 'px'
                });
                endObj.children('.shadow').css({
                    width: endShadowLeft + 'px',
                    left: -endShadowLeft
                });
            } else {
                let startShadowLeft = parseInt(startObj.css('left')); //获取开始接到到右边的距离
                startObj.children('.shadow').css({
                    width: endShadowLeft - startShadowLeft + 'px'
                });
            }
        }


//        添加点击事件
        private addClickFunc() {
            $('.pointer').on('click', (e: any) => {
                if (!this.addLineState) {
                    this.selectState = true;
                    this.changeRed();
                    let index = $(e.target).parent().attr('data-index');
                    let dataIndex = this.mapSearch(parseInt(index));
                    this.curIndex = index;
                    this.changeBlack();
                    if (this.setRythmStartState) {
                        this.rythemTxt = '请设置结束节拍';
                        this.startIndex = dataIndex;
                    }
                    if (this.setRythmEndState) {
                        this.initState();
                        this.endIndex = dataIndex;
                        this.drawRythem(this.startIndex, this.endIndex);
                    }
                    return false;
                } else {
                    this.$message.error('请先完成节拍添加！')
                }
            });
        }

//        添加节拍描述
        private addLabelFunc() {
            if (this.selectState) {
                this.selectState = false;
                this.changeRed();
                $('.tagPointer[data-index=' + this.curIndex + ']').children('p').html(this.value.split(' ')[0])
            } else {
                this.$message.error('请先选择标注线！')
            }
        }

//        设置节律开始标记
        private setStartHit() {
            this.initState();
            this.rythemTxt = '设置开始节拍中...';
            this.setRythmStartState = true;
        }

//        设置节律结束标记
        private setEndHit() {
            if (this.setRythmStartState) {
                this.setRythmStartState = false;
                this.initState();
                this.rythemTxt = '设置结束节拍中...';
                this.setRythmEndState = true;
            } else {
                this.$message.error('请先设置开始节拍！')
            }
        }

        private saveData() {
            console.log(this.tagData);
        }

//        组件加载完后添加事件
        mounted() {
            this.drawCanvas();
            this.drawTags();
            this.addClickFunc();
            $(document).on('keydown', (e: any) => {
                let keyCode = e.keyCode;
                if (keyCode === 46) {
                    this.removeLineFunc();
                }
                if (this.addLineState && keyCode === 27) {
                    $('.tagPointer[data-index=' + this.curIndex + ']').remove();
                    this.addLineState = false;
                }
                if (keyCode === 27) {
                    this.initState();
                }
                if (keyCode === 13) {
                    this.selectState = false;
                    $('.tagPointer[data-index=' + this.curIndex + ']').css({
                        backgroundColor: this.baseColor
                    });
                    return;
                }
                if (this.selectState) {
                    let obj = $('.tagPointer[data-index=' + this.curIndex + ']');
                    let offsetX = Number(obj.css('left').split('px')[0]);
                    this.transTagPointer(obj, offsetX, keyCode);
                }
            })
        }
    }
</script>

